CREATE TABLE IF NOT EXISTS `fb` (
	`id`	INTEGER NOT NULL,
	`name`	TEXT NOT NULL,
	PRIMARY KEY(`id`)
);


CREATE TABLE IF NOT EXISTS `color` (
	`Id`	INTEGER NOT NULL UNIQUE,
	`fd_id`	INTEGER NOT NULL,
	`page`	INTEGER NOT NULL,
	`row`	INTEGER NOT NULL,
	`name`	TEXT NOT NULL,
	`l`	NUMERIC NOT NULL,
	`a`	NUMERIC NOT NULL,
	`b`	NUMERIC NOT NULL,
	`rgb`	NUMERIC NOT NULL,
	`c`	INTEGER NOT NULL,
	`m`	INTEGER NOT NULL,
	`y`	INTEGER NOT NULL,
	`k`	INTEGER NOT NULL,
	PRIMARY KEY(`Id`)
);

